import React from 'react'
import {Link} from 'react-router-dom'
export default function New() {
  return (
    <ul>
    <li>
      <Link to="/new1">New01</Link>&nbsp;&nbsp;
    </li>
    <li>
      <a to="/new2">New02</a>&nbsp;&nbsp;
    </li>
    <li>
      <a to="/new3">New03</a>&nbsp;&nbsp;
    </li>
  </ul>
  )
}
